import React, { useEffect, useState } from 'react';
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
import '../node_modules/antd/dist/antd.css';
import { DownloadOutlined } from '@ant-design/icons';
import { Button } from 'antd';
import { useHistory } from 'react-router-dom';
import { Input } from 'antd';


const Country =()=>{
    const[data1,setData]=useState();
    useEffect(()=>{
        fetch('https://api.covid19api.com/summary')
        .then(response => response.json())
        .then(abc => 
        setData(abc)
        );
    },[]);
   const history= useHistory();

    const Logout=()=>{



      localStorage.removeItem("token")
        history.push('/');

    }

  return ( <div className="wrapper">
    <ul>
     <>
     <div className="container">
       <div className="row" style={{marginTop: '80px', float:'right'}}>
         <div className="col-md-8">
         <Input type="search" placeholder="Basic usage" />
         </div>
        <div className="col-md-4">
        <span >Logout</span> <Button onClick={Logout} type="primary" icon={<DownloadOutlined />}/>
        </div>

       </div>

       <div></div>
         <table className="table" style={{padding: "10px",marginTop: '50px',}}>
         <thead>
         <tr>
           <th>Country Name</th>
           <th>Country Code</th>
           <th>Date</th>
           <th>ID</th>
           <th>NewDeaths</th>
           <th>NewRecovered</th>
         </tr>
           </thead>
           {data1?.Countries.map(item => 
           <tbody>  
             <tr> 
             <td>{item.Country}</td>
             <td>{item.CountryCode}</td>
             <td>{item.Date}</td>
             <td>{item.Id}</td>
             <td>{item.NewDeaths}</td>
             <td>{item.NewRecovered}</td>
           </tr>
           </tbody>

            )}
         </table>   
         </div>   
      </>         

     { console.log(data1) }       
    </ul>
  </div>)


}

export default Country
